import React from "react";

const DefaultExport = () => {
    return(
        <div>
            <h1>Hello Aggies! Welcome to the comfort zone</h1>
            <p> Here you can use online fidget toys, recieve your chosen number of cat facts authorize your spotify account to connect to the application, and recieve a spotify API token. </p>
        </div>
    );
};

export default DefaultExport;
